pragma solidity ^0.8.0;

import "./ContractCertified.sol";
import "./Certifiers.sol";
import "../Array.sol";


contract ContractForbidder {
    using Array for bytes32[];

    SContractWithId[] private _forbidden;
    bool private _forbiddenunknown = false;

    function isContractForbiddenUnknown() virtual view public returns (bool) {
        return _forbiddenunknown;
    }
    function _contractForbiddenUnknownChanged(bool forbiddenunknown_) internal virtual {}
    function _contractForbiddenUnknownSet(bool forbiddenunknown_) internal returns (bool) {
        if (_forbiddenunknown==forbiddenunknown_)
            return false;
        _forbiddenunknown=forbiddenunknown_;
        _contractForbiddenUnknownChanged(_forbiddenunknown);
        return true;
    }
    function _contractForbiddenAdded(address contractAddr_,uint256 contractId_) internal virtual {}

    function _contractForbiddenRemoved(address contractAddr_,uint256 contractId_) internal virtual {}

    function _contractForbiddenAdd(address contractAddr_,uint256 contractId_) internal returns (bool) {
        uint len = _forbidden.length;
        for (uint i ;i<len;i++)
            if (_forbidden[i].contractAddr==contractAddr_&&_forbidden[i].contractId==0)
                return false;
        if (contractId_==0)
        {
            unchecked {
                for (uint i=len-1;i<len;i--)
                    if (_forbidden[i].contractAddr==contractAddr_)
                        _contractForbiddenRemove(_forbidden[i].contractAddr,_forbidden[i].contractId);

            }
        }
        else
        {
            for (uint i;i<len;i++)
                if (_forbidden[i].contractAddr==contractAddr_&&_forbidden[i].contractId==contractId_)
                    return false;
        }
        _forbidden.push(SContractWithId(contractAddr_,contractId_));
        _contractForbiddenAdded(contractAddr_,contractId_);
        return true;
    }

    function _contractForbiddenRemove(address contractAddr_,uint256 contractId_) internal returns (bool) {
        uint len = _forbidden.length;
        for (uint i;i<len;i++)
            if (_forbidden[i].contractAddr==contractAddr_&&_forbidden[i].contractId==contractId_)
            {
                if (i<len-1)
                    _forbidden[i] = _forbidden[len-1];
                _forbidden.pop();
                _contractForbiddenRemoved(contractAddr_,contractId_);
                return true;
            }
        return false;
    }
    function isContractForbidden(address contractAddr_,uint256 contractId_) public view virtual returns (bool) {
        uint len = _forbidden.length;
        for (uint i;i<len;i++)
             if ((_forbidden[i].contractAddr==contractAddr_&&_forbidden[i].contractId==0) 
                ||
                (_forbidden[i].contractAddr==contractAddr_&&_forbidden[i].contractId==contractId_))
                return true;
        return false;
    }
    function isContractAllowed(address contractAddr_,uint256 contractId_) public view virtual returns (bool) {
        if (isContractForbidden(contractAddr_,contractId_))
            return false;
        return !_forbiddenunknown;
    }

}

contract ContractForbidderCertifier is ContractCertifier, Certifiers,ContractForbidder {

    function supportsInterface(bytes4 interfaceId)
        public
        view virtual override(ContractCertifier,Certifiers)
        returns (bool)
    {
        return Certifiers.supportsInterface(interfaceId) || ContractCertifier.supportsInterface(interfaceId) ;
    }

    function isTrustedCertifier(address certifier_) public view virtual override(ContractCertifier,Certifiers) returns (bool)
    {
        return Certifiers.isTrustedCertifier(certifier_);
    }

    function isContractAllowed(address contractAddr_,uint256 contractId_) public view virtual override returns (bool) {
        if (ContractForbidder.isContractForbidden(contractAddr_,contractId_))
            return false;
        if (isContractCertified(contractAddr_,contractId_))
            return true;
        return !isContractForbiddenUnknown();
    }


}
